const e={type:"student_life.StudentLife",detail_url:"http://localhost/api/v2/pages/18/",html_url:null,slug:"student-life",show_in_menus:!1,seo_title:"",search_description:"",first_published_at:"2023-06-10T07:50:10.709800Z",alias_of:null,parent:{id:13,meta:{type:"base.Base",detail_url:"http://localhost/api/v2/pages/13/",html_url:null},title:"BAID 官网"},locale:"zh"},i="学生生活",t=["https://cms.beijing.academy/media/original_images/Header_1_XggkTpc.jpg"],a=[{id:1,meta:{type:"student_life.Activity"},name:"英文戏剧节",content:'<p data-block-key="l3asp">英文戏剧节是国际部同学们喜闻乐见的活动之一，由学生自己组织、策划、调控、统筹、演出的戏剧活动，以班级为单位进行演出。这是一个给予同学们无限可能的舞台，一个舞蹈教室，同学们用舞蹈和音乐串联起了整个剧目，同学们穿上特色戏服，以最充分的准备和饱满的热情投入到这项活动中，大家一起策划买戏服、置办道具、整理剧本，始终追求高品质，体现了很强的责任感。外教的指导追求精益求精，甚至在演出前一小时我们还临时加了一些细节，包括对演员表演的微调等，一切都是为了追求最好的效果。我们相信热烈的掌声是给予我们最好的回馈。</p>',image:"https://cms.beijing.academy/media/original_images/ED.jpg"},{id:2,meta:{type:"student_life.Activity"},name:"露营",content:'<p data-block-key="pvx44">每年9月的露营是同学们最期待的活动之一。组织年级的同学去户外，经历与同学一起合作实践搭建帐篷，经历体验自然、高空探险等项目，还要扎营做饭，在燃起的篝火旁展示才艺，发展协作能力与野外生活技能。男生半夜和男老师一起值勤，保护安睡的女同学和老师们，积极服务身边的人们。</p>',image:"https://cms.beijing.academy/media/original_images/Camping.jpg"},{id:3,meta:{type:"student_life.Activity"},name:"“北中杯”",content:'<p data-block-key="s9bch">学校每年举办“北中杯”师生篮球赛，同学和老师们都积极参与、乐在其中！在这场比赛里，同学们不仅锻炼了身体，思索了人生哲理。年龄与我们父辈相仿的老师原来也可以如少年般闪转腾挪，原来也可以嬉笑着大口喘粗气，和我们一样的。不知不觉间，在球场上已经没有师生的差异，已经没有成人与孩子的分别，这里友好自由的氛围，这里跟我们一起成长的老师，在这里的一切，无不彰显北中的平等开放自由，促进了深厚的师生情谊。</p><p data-block-key="cllkh">绿荫场上的“北中杯”校园足球赛，不仅展现了同学们的激情，飞扬现活力，更是让大家在绿茵赛场尽展风采，精彩的赛事在和煦的微风会点燃全校师生的运动热情。男生们会让踢得最好的几个人负责策略和战术安排，随后在紧张的课余时间抓紧练习；女生即使不上场，在后勤方面也发挥着巨大作用，如会购置队服、能量供给，安排啦啦队、音乐播放和摄影等，更是不忘欣赏场上同学们的英姿。经过连续几周的比赛，北中杯冠亚军各有所属，胜负已经不那么重要，收获的更多是信任、发现、支持、引导，特别是来自父母的支持，老师同学的关爱，增强了班集体的凝聚力，营造了和谐的校园氛围。和而不同，都乐在其中，世界因我更美好！</p>',image:"https://cms.beijing.academy/media/original_images/BZB.jpg"},{id:4,meta:{type:"student_life.Activity"},name:"自我挑战营",content:'<p data-block-key="cuzrq">自我挑战营</p>',image:"https://cms.beijing.academy/media/original_images/ZWTZY.jpg"},{id:5,meta:{type:"student_life.Activity"},name:"国际风情周",content:'<p data-block-key="8okgl">国际风情周</p>',image:"https://cms.beijing.academy/media/original_images/Header_2_NQlCi1j.jpg"},{id:6,meta:{type:"student_life.Activity"},name:"“北中好声音”",content:'<p data-block-key="xrllm">北中好声音让每一位愿意感受这份能量的表演者们都发光的场合，在这里，同学们聚在一起感受音乐，分享音乐，并一起度过这份仅仅因为艺术而艺术的时光。大家通过音乐表达情感，更是在向内发声。这样一种没有界限的语言让人与人达到共情，也让同学们与自我进行对话。这里有活力四射、配合默契的乐队，有功底深厚、天籁之音般独唱，有精湛熟练、婉转悠扬的弹唱……在精妙绝伦的表演中，同学们能感受到语言的多元性、形式的多元性、风格的多元性，也体现了北中“和而不同，乐在其中”的理念。</p>',image:"https://cms.beijing.academy/media/original_images/BZHSY.jpg"}],s=[{id:1,meta:{type:"student_life.Club"},name:"SLSD",icon:"https://cms.beijing.academy/media/original_images/LY.png",content:'<p data-block-key="zamc3">SLSD没图标</p>',images:["https://cms.beijing.academy/media/original_images/slsd1.jpeg","https://cms.beijing.academy/media/original_images/slsd2.jpeg","https://cms.beijing.academy/media/original_images/slsd3.jpeg","https://cms.beijing.academy/media/original_images/slsd4.jpeg"],color:"black",bg_color:"white"},{id:2,meta:{type:"student_life.Club"},name:"小花小草",icon:"https://cms.beijing.academy/media/original_images/XHXC.png",content:'<p data-block-key="h5sgi">小花小草</p>',images:["https://cms.beijing.academy/media/original_images/Dongba_2.jpg"],color:"black",bg_color:"white"},{id:3,meta:{type:"student_life.Club"},name:"绿眼",icon:"https://cms.beijing.academy/media/original_images/LY.png",content:'<p data-block-key="h5sgi">你有点太城市化了</p>',images:["https://cms.beijing.academy/media/original_images/Summer.jpg"],color:"black",bg_color:"white"},{id:4,meta:{type:"student_life.Club"},name:"神经科学社",icon:"https://cms.beijing.academy/media/original_images/NS.png",content:'<p data-block-key="h5sgi">NS</p>',images:["https://cms.beijing.academy/media/original_images/Dongba_1.jpg"],color:"black",bg_color:"white"},{id:5,meta:{type:"student_life.Club"},name:"法语社",icon:"https://cms.beijing.academy/media/original_images/French.png",content:'<p data-block-key="h5sgi">法语社</p>',images:["https://cms.beijing.academy/media/original_images/1.jpeg"],color:"black",bg_color:"white"}],d={id:18,meta:e,title:i,carousel_images:t,activities:a,clubs:s},l=10,m={type:"student_life.StudentLife",detail_url:"http://localhost/api/v2/pages/10/",html_url:null,slug:"student-life",show_in_menus:!1,seo_title:"",search_description:"",first_published_at:"2023-06-08T23:14:55.674902Z",alias_of:null,parent:{id:11,meta:{type:"base.Base",detail_url:"http://localhost/api/v2/pages/11/",html_url:null},title:"BAID Website"},locale:"en"},n="Student Life",c=[],g=[],o=[],p={id:l,meta:m,title:n,carousel_images:c,activities:g,clubs:o};export{p as a,d};
